( function($) {
	$(document).ready(function() { // bodyguard function
		// Browser detection
		checkBrowserCompatibility();
		$('.closeNotification').click(function(e){
			$(this).parent().slideUp('medium');
		});
		$('.readMore').click(function(e){
			$('.moreInfo').slideDown('medium');
			$('.readMore').remove();
		});
	});// bodyguard function
}) (jQuery);